script: |
  super -f tsv -I q3235.sql | sort > q3235.out

vector: true

inputs:
  - name: q3235.sql
    data: |
      SELECT - 57 FROM tab1 AS cor0 WHERE NOT 57 * - 39 + - col0 BETWEEN - col1 AND - col0 * - col1 * 13 + col1 * 78;
  - name: tab1

outputs:
  - name: q3235.out
    data: |
      -57
      -57
      -57
